'use strict'

moduleUsuario.controller('usuarioPlistFacturaControllerUsr', ['$scope', 'toolService', '$http', 'sessionService', '$routeParams', '$location', '$filter',
    function ($scope, toolService, $http, sessionService, $routeParams, $location, $filter) {
        if (parseInt($routeParams.id) === sessionService.getUserId()) {
            $scope.pagina = true;
            $scope.totalPages = 1;
            $scope.id = $routeParams.id;

            if (!$routeParams.order) {
                $scope.orderURLServidor = "";
                $scope.orderURLCliente = "";
            } else {
                $scope.orderURLServidor = "&order=" + $routeParams.order;
                $scope.orderURLCliente = $routeParams.order;
            }

            if (!$routeParams.rpp) {
                $scope.rpp = '5';
            } else {
                $scope.rpp = $routeParams.rpp;
            }

            if (!$routeParams.page) {
                $scope.page = 1;
            } else {
                if ($routeParams.page >= 1) {
                    $scope.page = $routeParams.page;
                } else {
                    $scope.page = 1;
                }
            }

            $scope.resetOrder = function () {
                $location.url(`usr/usuario/plistfactura/` + $scope.rpp + `/` + $scope.page);
            };


            $scope.ordena = function (order, align) {
                if ($scope.orderURLServidor === "") {
                    $scope.orderURLServidor = "&order=" + order + "," + align;
                    $scope.orderURLCliente = order + "," + align;
                } else {
                    $scope.orderURLServidor = $scope.orderURLServidor + "-" + order + "," + align;
                    $scope.orderURLCliente = $scope.orderURLCliente + "-" + order + "," + align;
                }
                $location.url(`usr/usuario/plistfactura/` + $scope.rpp + `/` + $scope.page + `/` + $scope.orderURLCliente);
            };

            $http({
                method: 'GET',
                url: '/json?ob=factura&op=getcountfacuser&id=' + $routeParams.id
            }).then(function (response) {
                $scope.status = response.status;
                $scope.ajaxDataUsuariosNumber = response.data.message;
                $scope.totalPages = Math.ceil($scope.ajaxDataUsuariosNumber / $scope.rpp);
                if ($scope.page > $scope.totalPages) {
                    $scope.page = $scope.totalPages;
                    $scope.actualiza();
                }
                pagination2();
            }, function (response) {
                $scope.ajaxDataUsuariosNumber = response.data.message || 'Request failed';
                $scope.status = response.status;
            });

            $http({
                method: 'GET',
                url: '/json?ob=factura&op=getpagexusuario&id=' + $routeParams.id + '&rpp=' + $scope.rpp + '&page=' + $scope.page + $scope.orderURLServidor
            }).then(function (response) {
                $scope.status = response.status;
                $scope.ajaxDataUsuarios = response.data.message;

            }, function (response) {
                $scope.status = response.status;
                $scope.ajaxDataUsuarios = response.data.message || 'Request failed';
            });
            $http({
                method: 'GET',
                url: '/json?ob=usuario&op=get&id=' + $routeParams.id
            }).then(function (response) {
                $scope.status = response.status;
                $scope.ajaxDatosUsuarios = response.data.message;

            }, function (response) {
                $scope.status = response.status;
                $scope.ajaxDatosUsuarios = response.data.message || 'Request failed';
            });

            $scope.actualiza = function () {
                $location.url(`usr/usuario/plistfactura/` + $scope.id + `/` + $scope.rpp + `/` + $scope.page + '/' + $scope.orderURLCliente);
            };


            function pagination2() {
                $scope.list2 = [];
                $scope.neighborhood = 1;
                for (var i = 1; i <= $scope.totalPages; i++) {
                    if (i === $scope.page) {
                        $scope.list2.push(i);
                    } else if (i <= $scope.page && i >= ($scope.page - $scope.neighborhood)) {
                        $scope.list2.push(i);
                    } else if (i >= $scope.page && i <= ($scope.page - -$scope.neighborhood)) {
                        $scope.list2.push(i);
                    } else if (i === ($scope.page - $scope.neighborhood) - 1) {
                        if ($scope.page >= 4) {
                            $scope.list2.push("...");
                        }
                    } else if (i === ($scope.page - -$scope.neighborhood) + 1) {
                        if ($scope.page <= $scope.totalPages - 3) {
                            $scope.list2.push("...");
                        }
                    }
                }
            }
            ;


            $scope.descargarPDF = function (id) {
                var usuario;
                var fecha;
                var lineasTotales;
                var iva;
                var length = $scope.ajaxDataUsuarios.length;

                var doc = new jsPDF();
                for (var i = 0; i < length; i++) {
                    console.log($scope.ajaxDataUsuarios[i]);
                    if ($scope.ajaxDataUsuarios[i].id === id) {
                        usuario = $scope.ajaxDataUsuarios[i].obj_Usuario.nombre + ' ' + $scope.ajaxDataUsuarios[i].obj_Usuario.ape1 + ' ' + $scope.ajaxDataUsuarios[i].obj_Usuario.ape2;
                        fecha = $scope.ajaxDataUsuarios[i].fecha;
                        lineasTotales = $scope.ajaxDataUsuarios[i].link_linea;
                        iva = $scope.ajaxDataUsuarios[i].iva;
                    }
                }
                ;
                $http({
                    method: 'GET',
                    url: 'json?ob=linea&op=getlineafactura&rpp=10000&page=1&id=' + id
                }).then(function (response) {
                    $scope.status = response.status;
                    $scope.ajaxLineasFactura = response.data.message;
                    console.log($scope.ajaxLineasFactura);
                    var imgData = 'data:image/png;base64,';

                    //Arriba
                    doc.setFontSize(30);
                    doc.setFontType('bold');
                    doc.text(75, 13, 'FACTURA');
                    doc.rect(8, 20, 195, 63);
                    doc.rect(8, 20, 65, 63);
                    doc.addImage(imgData, 'JPEG', 15, 30, 42, 40);
                    doc.setFontSize(13);
                    doc.setFontType('bold');
                    doc.text(80, 30, 'TrickShot');
                    doc.text(80, 40, 'Tel. 963 98 98 98');
                    doc.text(80, 50, 'Email prueba@gmail.com');
                    doc.text(80, 60, 'CIF. B45789856');
                    doc.text(80, 70, 'C/ Falsa N 123 Pta 25 Bajo');
                    doc.text(80, 80, '54861 Valencia (Valencia)');
                    doc.setFontSize(16);
                    doc.setFontType('bold');
                    doc.text(145, 30, 'Cliente:');
                    doc.text(145, 40, usuario);
                    doc.text(145, 55, 'Fecha:');
                    doc.text(145, 65, fecha);
                    doc.rect(8, 100, 195, 210);
                    doc.setFontSize(15);
                    doc.text(12, 90, 'Producto');
                    doc.text(120, 90, 'Cantidad');
                    doc.text(170, 90, 'Precio');
                    doc.setFillColor(0, 0, 0);
                    doc.rect(9, 92, 193, 5, 'F');
                    doc.setFontSize(15);

                //Lineas
                var linea = 107;
                var precio = 0;
                var cantidad = 0;
                for (var x = 0; x <= lineasTotales - 1; x++) {
                        if (x % 14 === 0 && x !== 0) {
                            doc.setFontSize(30);
                            doc.setFontType('bold');
                            doc.text(75, 13, 'FACTURA');
                            doc.rect(8, 20, 195, 63);
                            doc.rect(8, 20, 65, 63);
                            doc.addImage(imgData, 'JPEG', 10, 25, 42, 40);
                            doc.setFontSize(13);
                            doc.setFontType('bold');
                            doc.text(80, 30, 'TrickShot');
                            doc.text(80, 40, 'Tel. 963 98 98 98');
                            doc.text(80, 50, 'Email prueba@gmail.com');
                            doc.text(80, 60, 'CIF. B45789856');
                            doc.text(80, 70, 'C/ Falsa N 123 Pta 25 Bajo');
                            doc.text(80, 80, '54861 Valencia (Valencia)');
                            doc.setFontSize(16);
                            doc.setFontType('bold');
                            doc.text(145, 30, 'Cliente:');
                            doc.text(145, 40, usuario);
                            doc.text(145, 55, 'Fecha:');
                            doc.text(145, 65, fecha);
                            doc.rect(8, 110, 195, 210);
                            doc.setFontSize(15);
                            doc.text(12, 90, 'Modelo');
                            doc.text(120, 90, 'Cantidad');
                            doc.text(170, 90, 'Precio');
                            doc.setFillColor(0, 0, 0);
                            doc.rect(9, 108, 193, 5, 'F');
                            doc.setFontSize(15);
                            linea = 107;
                        }
                    doc.text(12, linea, $scope.ajaxLineasFactura[x].obj_Producto.codigo);
                    doc.text(120, linea, ($scope.ajaxLineasFactura[x].cantidad).toString());
                    doc.text(170, linea, (parseFloat(($scope.ajaxLineasFactura[x].obj_Producto.precio)).toFixed(2).toString()));
                    
                    linea = linea + 13;
                    precio = (precio + $scope.ajaxLineasFactura[x].obj_Producto.precio);
                    cantidad = cantidad + $scope.ajaxLineasFactura[x].cantidad;
                }
                    //Abajo
                    doc.setFillColor(0, 0, 0);
                    doc.rect(9, 260, 193, 5, 'F');
                    doc.text(12, 273, 'Cantidad Total');
                    doc.text(70, 273, 'Precio');
                    doc.text(115, 273, 'IVA');
                    doc.text(150, 273, 'Precio Total()');

                    doc.text(23, 285, cantidad.toString());
                    doc.text(70, 285, (precio.toFixed(2).toString()));
                    doc.text(115, 285, (precio * (iva / 100)).toFixed(2).toString());
                    doc.text(158, 285, (precio * (iva / 100 + 1)).toFixed(2).toString());

                    doc.output('save', 'Factura-' + id + '.pdf');
                 }, function (response) {
                    $scope.status = response.status;
                    $scope.ajaxLineasFactura = response.data.message || 'Request failed';
                });





            };


            $scope.isActive = toolService.isActive;
        } else {
            $scope.pagina = false;
        }
    }
]);
